function generateUUID(){var a=(new Date).getTime();return"xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx".replace(/[xy]/g,function(b){var c=(a+16*Math.random())%16|0;a=Math.floor(a/16);return("x"==b?c:c&3|8).toString(16)})}Array.prototype.suffle=function(){for(var a=this.length,b=0;b<a;b++){var c=Math.floor(Math.random()*a),d=this[b];this[b]=this[c];this[c]=d}};
